import React from 'react'
import CriarProcesso from '../components/CriarProcesso'
import Axios from 'axios'
import '../assets/css/base/base.css'


const Home = () => {

  const listarProcessos = () => {
    console.log("clicou");
    Axios.post('http://localhost:5000/listaProcessos').then((response) => {
      console.log(response);
    })
  }

  return (
    <main>
      <div className="container">
        <h2 className="titulo-pagina">Lista de Processos</h2>
      </div>
      <CriarProcesso />
      <div className="container">
        <button className="botao" onClick={listarProcessos}>Listar Processos</button>
      </div>

    </main>
  )
}

export default Home
